import React, { useState } from 'react';
import TraineeDetailsPage from './TraineeDetailsPage';

function MentorHomePage() {
  const [trainees, setTrainees] = useState([
    { id: 1, name: "Alice" },
    { id: 2, name: "Bob" },
    { id: 3, name: "Charlie" },
    { id: 4, name: "David" },
    { id: 5, name: "Eve" },
    { id: 6, name: "Frank" },
    { id: 7, name: "Grace" },
    { id: 8, name: "Harry" },
    { id: 9, name: "Iris" },
    { id: 10, name: "Jack" },
    { id: 11, name: "Kate" },
    { id: 12, name: "Leo" },
    // ... more trainees
  ]);

  const [currentPage, setCurrentPage] = useState(1);
  const traineesPerPage = 10;
  const totalPages = Math.ceil(trainees.length / traineesPerPage);

  const handleTraineeClick = (trainee) => {
    setSelectedTrainee(trainee);
  };

  const handlePageClick = (page) => {
    setCurrentPage(page);
    setSelectedTrainee(null);
  };

  const traineesOnPage = trainees.slice(
    (currentPage - 1) * traineesPerPage,
    currentPage * traineesPerPage
  );

  const traineeList = traineesOnPage.map((trainee) => (
    <li key={trainee.id} onClick={() => handleTraineeClick(trainee)}>
      {trainee.name}
    </li>
  ));

  const pagination = [];
  for (let i = 1; i <= totalPages; i++) {
    pagination.push(
      <button key={i} onClick={() => handlePageClick(i)}>
        {i}
      </button>
    );
  }

  return (
    <div>
      <h1>Trainees Info</h1>
      <ul>{traineeList}</ul>
      <div>{pagination}</div>
      {selectedTrainee && <TraineeDetailsPage trainee={selectedTrainee} />}
    </div>
  );
}

export default MentorHomePage;
